const fz = require("zigbee-herdsman-converters/converters/fromZigbee");
const tz = require("zigbee-herdsman-converters/converters/toZigbee");
const exposes = require("zigbee-herdsman-converters/lib/exposes");
const reporting = require("zigbee-herdsman-converters/lib/reporting");
const extend = require("zigbee-herdsman-converters/lib/extend");
const utils = require("zigbee-herdsman-converters/lib/utils");
const e = exposes.presets;
const ea = exposes.access;

const types = {
  bool: 0x10,
  uint8: 0x20,
  uint16: 0x21,
  int16: 0x29,
};

const attributes = {
  fault: {
    msg: 0x0201,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Boiler has a fault"),
  },
  central_heating_active: {
    msg: 0x0202,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Central heating is active"),
  },
  domestic_hot_water_active: {
    msg: 0x0203,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Domestic hot water is active"),
  },
  flame_on: {
    msg: 0x0204,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Flame is on"),
  },
  control_setpoint: {
    msg: 0x0205,
    type: types.int16,
    canSet: true,
    scale: 0.01,
    exposes: (name) =>
      exposes
        .numeric(name, ea.GET | ea.SET)
        .withDescription("Control setpoint")
        .withValueMin(0)
        .withValueMax(100)
        .withUnit("°C"),
  },
  central_heating_water_pressure: {
    msg: 0x0206,
    type: types.uint16,
    scale: 0.01 * 100000, // The value is reported in millibar. 1 bar is 100,000 Pa.
    exposes: (name) =>
      exposes
        .numeric(name, ea.STATE)
        .withDescription("Central heating water pressure")
        .withUnit("Pa"),
  },
  burner_operation_hours: {
    msg: 0x0207,
    type: types.uint16,
    exposes: (name) =>
      exposes
        .numeric(name, ea.STATE)
        .withDescription("Burner operation hours")
        .withUnit("hour"),
  },
  burner_starts: {
    msg: 0x0208,
    type: types.uint16,
    exposes: (name) =>
      exposes.numeric(name, ea.STATE).withDescription("Burner starts"),
  },
  domestic_hot_water_burner_operation_hours: {
    msg: 0x0209,
    type: types.uint16,
    exposes: (name) =>
      exposes
        .numeric(name, ea.STATE)
        .withDescription("Domestic hot water burner operation hours")
        .withUnit("hour"),
  },
  application_specific_fault_service_request: {
    msg: 0x020a,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: service request"),
  },
  application_specific_fault_lockout_request: {
    msg: 0x020b,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: lockout request"),
  },
  application_specific_fault_low_water_pressure: {
    msg: 0x020c,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: low water pressure"),
  },
  application_specific_fault_gas_flame_fault: {
    msg: 0x020d,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: gas flame fault"),
  },
  application_specific_fault_air_pressure_fault: {
    msg: 0x020e,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: air pressure fault"),
  },
  application_specific_fault_water_over_temperature: {
    msg: 0x020f,
    type: types.bool,
    exposes: (name) =>
      exposes
        .binary(name, ea.STATE, "on", "off")
        .withDescription("Application specific fault: water over temperature"),
  },
  oem_fault_code: {
    msg: 0x0210,
    type: types.uint8,
    exposes: (name) =>
      exposes
        .numeric(name, ea.STATE)
        .withDescription("OEM fault code")
        .withValueMin(0)
        .withValueMax(255),
  },
  boiler_temperature: {
    msg: 0x0211,
    type: types.int16,
    scale: 0.01,
    exposes: (name) =>
      exposes
        .numeric(name, ea.STATE)
        .withDescription("Boiler temperature")
        .withValueMin(0)
        .withValueMax(100)
        .withUnit("°C"),
  },
};

const fzLocal = {
  boiler_configuration: {
    cluster: "genOnOff",
    type: ["attributeReport", "readResponse"],
    convert: (model, msg, publish, options, meta) => {
      const result = {};

      Object.entries(attributes).forEach(([name, attribute]) => {
        if (msg.data.hasOwnProperty(attribute.msg)) {
          let value = msg.data[attribute.msg];
          if (attribute.scale) {
            value *= attribute.scale;
          }
          if (attribute.type == types.bool) {
            value = value ? "on" : "off";
          }
          result[name] = value;
        }
      });

      return result;
    },
  },
};

const tzLocal = Object.fromEntries(
  Object.entries(attributes).map(([name, attribute]) => {
    const result = {
      key: [name],
      convertGet: async (entity, key, meta) => {
        await entity.read("genOnOff", [attribute.msg]);
      },
    };

    if (attribute.canSet) {
      result.convertSet = async (entity, key, value, meta) => {
        let publishValue = value;
        if (attribute.scale) {
          publishValue = (publishValue / attribute.scale) | 0;
        }

        await entity.write("genOnOff", {
          [attribute.msg]: { publishValue, type: attribute.type },
        });

        return { state: { [name]: value } };
      };
    }

    return [name, result];
  })
);

const eLocal = Object.fromEntries(
  Object.entries(attributes).map(([name, attribute]) => {
    return [name, () => attribute.exposes(name)];
  })
);

const definition = {
  zigbeeModel: ["Boiler"],
  model: "Boiler",
  vendor: "Pieter",
  description: "Boiler on/off device with metrics",
  fromZigbee: [fz.on_off, fzLocal.boiler_configuration],
  toZigbee: [tz.on_off, ...Object.values(tzLocal)],
  exposes: [e.switch(), ...Object.values(eLocal).map((p) => p())],
  icon: "data:image/jpeg;base64,",
  configure: async (device, coordinatorEndpoint, logger) => {
    const endpoint = device.getEndpoint(1);

    await reporting.bind(endpoint, coordinatorEndpoint, [
      "genOnOff",
      ...Object.values(attributes).map((attribute) => attribute.msg),
    ]);

    await endpoint.configureReporting("genOnOff", [
      {
        attribute: "onOff",
        minimumReportInterval: 0,
        maximumReportInterval: 3600,
        reportableChange: null,
      },
    ]);

    for (const attribute of Object.values(attributes)) {
      await endpoint.configureReporting("genOnOff", [
        {
          attribute: { ID: attribute.msg, type: attribute.type },
          minimumReportInterval: 0,
          maximumReportInterval: 3600,
          reportableChange: null,
        },
      ]);
    }
  },
  onEvent: async (type, data, device, options, state) => {
    /*
     * The Arduino isn't storing reporting configuration. We use the announce
     * event to send the reporting configuration again.
     */
    if (type === "deviceAnnounce") {
      for (const endpoint of device.endpoints) {
        for (const c of endpoint.configuredReportings) {
          let attribute = c.attribute.name;

          // The endpoint configuration doesn't store the type. We have
          // to re-retrieve it from our metadata.
          if (!attribute) {
            attribute = {
              ID: c.attribute.ID,
              type: Object.values(attributes).find(
                (p) => p.msg === c.attribute.ID
              ).type,
            };
          }

          await endpoint.configureReporting(c.cluster.name, [
            {
              attribute: attribute,
              minimumReportInterval: c.minimumReportInterval,
              maximumReportInterval: c.maximumReportInterval,
              reportableChange: c.reportableChange,
            },
          ]);
        }
      }
    }
  },
};

module.exports = definition;
